import React from "react";
import Stories from "react-insta-stories";
import sr1 from "../../assets/giphy.gif?url"
import sr2 from "../../assets/images.jpeg?url"
import sr3 from "../../assets/@lepragram.mp4?url"

function MCStories() {
  return (
    <div>
      <Stories
        stories={[
          { url: sr1},
          { url: sr2},
          { url: sr3},
        ]}
        defaultInterval={1500}
        width={600}
        height={800}
      />
    </div>
  );
}

export default MCStories;
